import { NavLink, useHistory } from "react-router-dom";
export default function Header({ loggedIn, admin, logout }) {
  const history = useHistory();

  function onClick(e) {
    e.preventDefault();
    logout();
    history.push("/");
  }

  return (
    <ul className="header">
      {!admin ? (
        <li >
          <NavLink exact activeClassName="active" className="title" to="/">
            Sign Up
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {!admin ? (
        <li>
          <NavLink activeClassName="active" to="/offer">
            Offer
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {!admin ? (
        <li>
          <NavLink activeClassName="active" to="/pack">
            Package
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {!admin && !loggedIn ? (
        <li>
          <NavLink activeClassName="active" to="/register">
            Register
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {loggedIn && !admin ? (
        <li>
          <NavLink activeClassName="active" to="/account">
            Account
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {!admin ? (
        <li>
          <NavLink activeClassName="active" to="/newpack">
            New Package
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {admin ? (
        <li>
          <NavLink activeClassName="active" to="/orders">
            Orders
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {admin ? (
        <li>
          <NavLink activeClassName="active" to="/users">
            Users
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {admin ? (
        <li>
          <NavLink activeClassName="active" to="/statistics">
            Statisticks
          </NavLink>
        </li>
      ) : (
        ""
      )}

      {!admin && !loggedIn ? (
        <li>
          <NavLink activeClassName="active" to="/login">
            Log in
          </NavLink>
        </li>
      ) : (
        ""
      )}
      {admin || loggedIn ? (
        <li>
          <button className="active" onClick={onClick}>
            Log out
          </button>
        </li>
      ) : (
        ""
      )}
    </ul>
  );
}
